Information
------------------------------

World's Weirdest: Sharks
Sharks are one of the oldest animals on the planet; they were already old before the dinosaurs came. So they have had plenty of time to evolve and diverge into one of the weirdest most diverse assemblages of animals we know of. From slow moving filter feeders, to catfish like bottom huggers, to recently discovered facts about our most famous sharks, this is a rundown of exactly how weird sharks can be.

